import React from 'react'
import './App.css'

class Subsection extends React.Component {

	render() {
		return (
			<div>
				<h3>Subsections</h3>
				{
					this.state.data.section.subsection.map((item) =>
				<div>
				<h4>{item.number}</h4>	
				<ul>
					<li>{item.location}</li>
					<li>Metting Times
						<ul>
						{
							item.details.map((subitem, i) => 
						<li>{i}:{subitem}</li>
						)
						}
						</ul>
					</li>
				</ul>) 
				</div>)
				}
			</div>
		)
	}
}

export default Subsection;
